// setup algorithm 
var token = '__cfduid=dd9ba26fce26de6804f42a1c44c7635711530694744; .'
var minBalance = 100
var balanceBet = 5
// get ball list 
wtb.getBalance(token).then(balance => {
  if (balance > minBalance) {
    //log(balance)
    wtb.getBall(token, {
      brokerId: wtb.borker.forex,
      symbolId: wtb.forex.AUDUSD
    }).then(balls => {
      let isGreenBall = balls[balls.length - 1].Result == 1 ? true : false
      wtb.bet(token, {
        brokerId: wtb.borker.forex, // forex 1, coin 2
        symbolId: wtb.forex.DIAMOND, // curentcy type
        BetChoice: isGreenBall ? wtb.choice.BUY : wtb.choice.SELL, // buy 1, sell 2
        BetFrom: 'w',
        Stake: balanceBet, // $
      }).then(result => {
        log(result)
      }, error => {
        log(error)
      })
    })
  }
  else {
    log(`Balance is comming min value : ${balance}`)
  }

})

